import React, { useState, useEffect } from 'react';
import {
  Box,
  Grid,
  Card,
  CardContent,
  Typography,
  Button,
  CircularProgress,
  Chip,
  Alert,
  LinearProgress,
} from '@mui/material';
import {
  TrendingUp,
  Eco,
  AccountBalance,
  Store,
  Assessment,
  Add,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { reportsAPI, healthAPI } from '../services/api';
import { useSnackbar } from 'notistack';

const Dashboard = () => {
  const navigate = useNavigate();
  const { enqueueSnackbar } = useSnackbar();
  const [dashboardData, setDashboardData] = useState(null);
  const [systemHealth, setSystemHealth] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      setLoading(true);
      const [dashboardResult, healthResult] = await Promise.all([
        reportsAPI.getSystemDashboard(),
        healthAPI.check(),
      ]);

      setDashboardData(dashboardResult);
      setSystemHealth(healthResult);
    } catch (error) {
      enqueueSnackbar('Failed to load dashboard data', { variant: 'error' });
    } finally {
      setLoading(false);
    }
  };

  const workflowSteps = [
    {
      step: 1,
      title: 'Project Registration',
      description: 'Create new blue carbon restoration project',
      action: () => navigate('/projects/create'),
      icon: <Add />,
      color: '#1976d2',
    },
    {
      step: 2,
      title: 'Admin Review',
      description: 'NCCR admin review and approval',
      action: () => navigate('/admin'),
      icon: <Assessment />,
      color: '#f57c00',
    },
    {
      step: 3,
      title: 'Data Collection',
      description: 'Field data collection and monitoring',
      action: () => navigate('/data-collection'),
      icon: <Eco />,
      color: '#388e3c',
    },
    {
      step: 4,
      title: 'Verification',
      description: 'Multi-source data verification',
      action: () => navigate('/verification'),
      icon: <TrendingUp />,
      color: '#7b1fa2',
    },
    {
      step: 5,
      title: 'Credit Marketplace',
      description: 'Trade verified carbon credits',
      action: () => navigate('/marketplace'),
      icon: <Store />,
      color: '#d32f2f',
    },
  ];

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" height={400}>
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Box>
      <Typography variant="h4" gutterBottom sx={{ mb: 3 }}>
        Blue Carbon MRV Dashboard
      </Typography>

      {/* System Health Alert */}
      {systemHealth && (
        <Alert 
          severity={systemHealth.blockchain_connected ? 'success' : 'warning'}
          sx={{ mb: 3 }}
        >
          Blockchain: {systemHealth.blockchain_connected ? 'Connected' : 'Disconnected'} | 
          IPFS: {systemHealth.ipfs_available ? 'Available' : 'Unavailable'} | 
          Last Updated: {new Date(systemHealth.timestamp).toLocaleString()}
        </Alert>
      )}

      {/* Key Statistics */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <Card>
            <CardContent>
              <Box display="flex" alignItems="center" justifyContent="space-between">
                <Box>
                  <Typography color="textSecondary" gutterBottom>
                    Total Projects
                  </Typography>
                  <Typography variant="h4">
                    {dashboardData?.system_statistics?.total_projects || 0}
                  </Typography>
                </Box>
                <AccountBalance color="primary" sx={{ fontSize: 40 }} />
              </Box>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Card>
            <CardContent>
              <Box display="flex" alignItems="center" justifyContent="space-between">
                <Box>
                  <Typography color="textSecondary" gutterBottom>
                    Carbon Credits
                  </Typography>
                  <Typography variant="h4">
                    {dashboardData?.system_statistics?.total_carbon_credits || 0}
                  </Typography>
                </Box>
                <Eco color="secondary" sx={{ fontSize: 40 }} />
              </Box>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Card>
            <CardContent>
              <Box display="flex" alignItems="center" justifyContent="space-between">
                <Box>
                  <Typography color="textSecondary" gutterBottom>
                    Area Restored
                  </Typography>
                  <Typography variant="h4">
                    {dashboardData?.system_statistics?.total_area_restored_hectares || 0}
                  </Typography>
                  <Typography variant="caption">hectares</Typography>
                </Box>
                <TrendingUp color="success" sx={{ fontSize: 40 }} />
              </Box>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Card>
            <CardContent>
              <Box display="flex" alignItems="center" justifyContent="space-between">
                <Box>
                  <Typography color="textSecondary" gutterBottom>
                    Active Listings
                  </Typography>
                  <Typography variant="h4">
                    {dashboardData?.system_statistics?.active_marketplace_listings || 0}
                  </Typography>
                </Box>
                <Store color="error" sx={{ fontSize: 40 }} />
              </Box>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Project Status Breakdown */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Project Status Overview
              </Typography>
              {dashboardData?.project_status_breakdown && (
                <Box>
                  {Object.entries(dashboardData.project_status_breakdown).map(([status, count]) => (
                    <Box key={status} sx={{ mb: 2 }}>
                      <Box display="flex" justifyContent="space-between" alignItems="center">
                        <Chip 
                          label={`${status.charAt(0).toUpperCase() + status.slice(1)}: ${count}`}
                          color={
                            status === 'approved' ? 'success' :
                            status === 'rejected' ? 'error' :
                            status === 'verified' ? 'primary' :
                            'default'
                          }
                          size="small"
                        />
                        <Typography variant="body2">{count} projects</Typography>
                      </Box>
                      <LinearProgress 
                        variant="determinate" 
                        value={(count / (dashboardData.system_statistics.total_projects || 1)) * 100}
                        sx={{ mt: 1 }}
                      />
                    </Box>
                  ))}
                </Box>
              )}
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Blockchain Status
              </Typography>
              {systemHealth?.blockchain_status && (
                <Box>
                  <Typography variant="body2" sx={{ mb: 1 }}>
                    Network: {systemHealth.blockchain_status.network}
                  </Typography>
                  <Typography variant="body2" sx={{ mb: 1 }}>
                    Status: {systemHealth.blockchain_status.connected ? '🟢 Connected' : '🔴 Disconnected'}
                  </Typography>
                  {systemHealth.blockchain_status.latest_block && (
                    <Typography variant="body2" sx={{ mb: 1 }}>
                      Latest Block: {systemHealth.blockchain_status.latest_block}
                    </Typography>
                  )}
                </Box>
              )}
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* MRV Workflow Steps */}
      <Card sx={{ mb: 4 }}>
        <CardContent>
          <Typography variant="h6" gutterBottom sx={{ mb: 3 }}>
            Complete MRV Workflow
          </Typography>
          <Grid container spacing={2}>
            {workflowSteps.map((step) => (
              <Grid item xs={12} sm={6} md={2.4} key={step.step}>
                <Card 
                  sx={{ 
                    height: '100%',
                    cursor: 'pointer',
                    transition: 'transform 0.2s',
                    '&:hover': {
                      transform: 'translateY(-4px)',
                    },
                  }}
                  onClick={step.action}
                >
                  <CardContent sx={{ textAlign: 'center', p: 2 }}>
                    <Box
                      sx={{
                        width: 60,
                        height: 60,
                        borderRadius: '50%',
                        backgroundColor: step.color,
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'center',
                        margin: '0 auto 16px',
                        color: 'white',
                      }}
                    >
                      {step.icon}
                    </Box>
                    <Typography variant="h6" sx={{ fontSize: '0.9rem', mb: 1 }}>
                      Step {step.step}
                    </Typography>
                    <Typography variant="body2" sx={{ fontWeight: 'bold', mb: 1 }}>
                      {step.title}
                    </Typography>
                    <Typography variant="caption" color="textSecondary">
                      {step.description}
                    </Typography>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </CardContent>
      </Card>

      {/* Recent Activity */}
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Projects
              </Typography>
              {dashboardData?.recent_activity?.recent_projects?.map((project, index) => (
                <Box key={project.id} sx={{ mb: 2, p: 2, bgcolor: 'grey.50', borderRadius: 1 }}>
                  <Typography variant="body2" fontWeight="bold">
                    {project.project_name}
                  </Typography>
                  <Typography variant="caption" color="textSecondary">
                    {project.ecosystem_type} • {project.area_hectares} ha
                  </Typography>
                  <Chip 
                    label={project.status} 
                    size="small" 
                    color={project.status === 'approved' ? 'success' : 'default'}
                    sx={{ mt: 1 }}
                  />
                </Box>
              )) || (
                <Typography variant="body2" color="textSecondary">
                  No recent projects
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Recent Verifications
              </Typography>
              {dashboardData?.recent_activity?.recent_verifications?.map((verification, index) => (
                <Box key={verification.id} sx={{ mb: 2, p: 2, bgcolor: 'grey.50', borderRadius: 1 }}>
                  <Typography variant="body2" fontWeight="bold">
                    {verification.project_id}
                  </Typography>
                  <Typography variant="caption" color="textSecondary">
                    {verification.carbon_credits_calculated} credits
                  </Typography>
                  <Chip 
                    label={verification.verification_status} 
                    size="small" 
                    color="primary"
                    sx={{ mt: 1 }}
                  />
                </Box>
              )) || (
                <Typography variant="body2" color="textSecondary">
                  No recent verifications
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} md={4}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Marketplace Activity
              </Typography>
              {dashboardData?.recent_activity?.recent_marketplace_activity?.map((activity, index) => (
                <Box key={activity.listing_id} sx={{ mb: 2, p: 2, bgcolor: 'grey.50', borderRadius: 1 }}>
                  <Typography variant="body2" fontWeight="bold">
                    {activity.credit_amount} Credits
                  </Typography>
                  <Typography variant="caption" color="textSecondary">
                    {activity.price_per_credit} MATIC each
                  </Typography>
                  <Chip 
                    label={activity.status} 
                    size="small" 
                    color="secondary"
                    sx={{ mt: 1 }}
                  />
                </Box>
              )) || (
                <Typography variant="body2" color="textSecondary">
                  No recent marketplace activity
                </Typography>
              )}
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Quick Actions */}
      <Box sx={{ mt: 4, display: 'flex', gap: 2, justifyContent: 'center' }}>
        <Button 
          variant="contained" 
          size="large"
          startIcon={<Add />}
          onClick={() => navigate('/projects/create')}
        >
          Create New Project
        </Button>
        <Button 
          variant="outlined" 
          size="large"
          onClick={() => navigate('/reports')}
        >
          View Full Reports
        </Button>
      </Box>
    </Box>
  );
};

export default Dashboard;
